Note: there's a whole section on refactoring to reduce coupling right here . Consider the following code: public class Client { public void bar(D d) { E e = d.getE(); e.doTheThing(); }
} Here, bar(d) is coupled to both D and E. Through D, it "talks" to E. To reduce coupling, we can refactor D to handle the interaction with E itself so that bar(d) only needs to talk with D. public class Client { public void bar(D d) { d.doTheThingOnE(); }
} This follows the guideline known as the Law of Demeter. Law of Demeter Only talk to immediate friends. Each unit should have only limited knowledge about other units: only units "closely" related to the current unit. The Law of Demeter says that "a given object should assume as little as possible about the structure or properties of anything else (including its subcomponents), in accordance with the principle of information hiding ."

