Consider the following example: public class RemoteControl { private SamsungTV tv; public void turnOn() { tv.on(); }
} public class SamsungTV { public void on(); public void off(); public void tuneChannel(int channel);
} Here, RemoteControl is tightly coupled with (and will be affected by changes to) SamsungTV. It also has no way to interface with other TV brands. We can reduce coupling by introducing an interface TV and making SamsungTV implement the interface. public class RemoteControl { private TV tv; public void turnOn() { tv.on(); } } public interface TV { public abstract void on(); public abstract void off(); public abstract void tuneChannel(int channel); } public class SamsungTV implements TV { public void on(); public void off(); public void tuneCHannel(int channel); } With that refactoring, we've decoupled RemoteControl from SamsungTV. This gives us the freedom to implement new classes such as PhilipsTV without tightening the coupling of RemoteControl.

