Violation of a pre/postcondition at runtime indicates the existence of a bug. The Precondition Violation Rule A precondition violation is the manifestation of a bug in the client regardless of whether the post condition is satisfied or violated. In other words, if the client does not fulfill its contract, then the supplier is not bound by the postcondition. // Precondition: x >= 0
// Postcondition: abs(sqrt(x) * sqrt(x) - x) < epsilon
double sqrt(double x); When x = -1, the implementation breaks. Because the client violated the precondition, the client code is faulty. The Postcondition Violation Rule A postcondition violation is the manifestation of a bug in the supplier because the supplier did not fulfill its contract. // Precondition: letter in 'a'..'z' || 'A'..'Z'
// Postcondition: return true if letter is a vowel
// false otherwise boolean isVowel(char letter) { String vowels = "aiouy" // 'e' is missing char ch = Character.toLowerCase(letter); return vowels.indexOf(ch) >= 0;
} The call isVowel('E') incorrectly returns false. Because the client satisfied the precondition and the server violated the postcondition, the supplier code is faulty.

